// SPDX-License-Identifier: MIT
pragma solidity ^0.8;
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

contract Designer is ERC721 {

    struct product{
        uint id;
        string name;
    }

    struct designer{
        uint id;
        address addr;
        string name;
        bytes32 imgHash;
        mapping(uint => product) LaunchedProd;
        mapping(uint => product) SavedProd;
    }

    event RegistrationDesgSucc(address addr , string s);

    enum LogStatus {SUCCESS , FAIL}
    LogStatus status;

    event LoggedInDesg(address addr , LogStatus);

    mapping(address => designer) registeredDesg;

    mapping(string => bool) nameList;

    modifier addrAlreadyUsed(address _sender){
        require(_sender != registeredDesg[_sender].addr,"Address already exists");
        _;
    }

    modifier nameExists(string memory _name){
        require(!nameList[_name] , "Name already taken");
        _;
    }

    constructor() ERC721("product","PRODUCT") public{
        //do something...
    }

    function register(string memory _name , bytes32 _imgHash) external addrAlreadyUsed(msg.sender) {
        designer storage newDesg = registeredDesg[msg.sender];
        newDesg.id = 1001;
        newDesg.addr = msg.sender;
        newDesg.name = _name;
        newDesg.imgHash = _imgHash;
        emit RegistrationDesgSucc(msg.sender , 'Registered');
    }

    function login(uint _id) external {
        require(msg.sender == registeredDesg[msg.sender].addr , "Address not found");
        require(registeredDesg[msg.sender].id == _id , "Incorrect Id");
        emit LoggedInDesg(msg.sender,LogStatus.SUCCESS);
    }

    function regProd(string memory _name) external nameExists(_name){
        require(msg.sender == registeredDesg[msg.sender].addr , "Address not found");
        product memory p = product({id:10001,name:_name});
        registeredDesg[msg.sender].SavedProd[10001] = p;
        _mint(msg.sender ,10001);
    }
}
